import React, { Component } from "react";
import { connect } from "dva";
import PostItems from "../Components/postitems";
import 'antd/dist/antd.css';
import {Button} from 'antd';

class posts extends Component {
  componentDidMount(){
    this.props.dispatch({ type: "posts/getData" })
  }
  handle=()=>{
    console.log("clicked");
  }
  render() {
    return (
      <React.Fragment>
        <h1>Posts</h1>
        <div>
        <Button type="primary" onClick={this.handle}>Primary</Button>
          {console.log(this.props.getDataState)}
          {this.props.getDataState.map((post)=><PostItems key={post.id} post={post}></PostItems>)}
        </div>
      </React.Fragment>
    );
  }
}

const mapStateToProps = state => {
  return {
    getData: state.posts.getData,
    getDataState:state.posts.items
  };
};

export default connect(mapStateToProps)(posts);
